import React, {Component} from 'react'
import './App.css';
import background from './background.png';

var sectionStyle = {
  width: "100vw",
  height: "100vh",
  backgroundImage: `url(${ background })`,
  backgroundSize: "cover",
  marginTop: "0"
};

class App extends Component {

  render() {
    return (
      <div className="App">
        <section style={sectionStyle}>
          <h1> Aliens CRUD </h1>
        </section>
      </div>
    );
  }
}

export default App;
